import{_ as e,c as t,o as l,a as o}from"./app.0b159a37.js";const f=JSON.parse('{"title":"README","description":"","frontmatter":{"title":"README","tags":["HTML"],"创建时间":"星期三, 七月 27日 2022, 8:58:57 晚上","修改时间":"星期一, 十一月 14日 2022, 2:45:58 下午"},"headers":[{"level":2,"title":"常见的语义化标签","slug":"常见的语义化标签","link":"#常见的语义化标签","children":[]}],"relativePath":"工作区/基本知识/HTML/README.md"}'),i={name:"工作区/基本知识/HTML/README.md"},d=o('<h1 id="readme" tabindex="-1">README <a class="header-anchor" href="#readme" aria-hidden="true">#</a></h1><h2 id="常见的语义化标签" tabindex="-1">常见的语义化标签 <a class="header-anchor" href="#常见的语义化标签" aria-hidden="true">#</a></h2><ul><li><code>&lt;title&gt;</code>：页面主体内容</li><li><code>&lt;hn&gt;</code>：h1 ~ h6，分级标题， <code>&lt;hn&gt;</code> 与<code>&lt;title&gt;</code> 协调有利于搜索引擎优化</li><li><code>&lt;ul&gt;</code>：无序列表</li><li><code>&lt;ol&gt;</code>：有序列表</li><li><code>&lt;header&gt;</code>：页眉通常包括网站标志、主导航、全站链接以及搜索框。</li><li><code>&lt;nav&gt;</code>：标记导航，仅对文档中重要的链接群使用。</li><li><code>&lt;main&gt;</code>：页面主要内容，一个页面只能使用一次。如果是web应用，则包围其主要功能。</li><li><code>&lt;article&gt;</code>：定义外部的内容，其中的内容独立于文档的其余部分。</li><li><code>&lt;section&gt;</code>：定义文档中的节（section、区段）。比如章节、页眉、页脚或文档中的其他部分。</li><li><code>&lt;aside&gt;</code>：定义其所处内容之外的内容。如侧栏、文章的一组链接、广告、友情链接、相关产品列表等。</li><li><code>&lt;footer&gt;</code>：页脚，只有当父级是body时，才是整个页面的页脚。</li><li><code>&lt;small&gt;</code>：呈现小号字体效果，指定细则，输入免责声明、注解、署名、版权。</li><li><code>&lt;strong&gt;</code>：和 em 标签一样，用于强调文本，但它强调的程度更强一些。</li><li><code>&lt;em&gt;</code>：将其中的文本表示为强调的内容，表现为斜体。</li><li><code>&lt;mark&gt;</code>：使用黄色突出显示部分文本。</li><li><code>&lt;figure&gt;</code>：规定独立的流内容（图像、图表、照片、代码等等）（默认有40px左右margin）。</li><li><code>&lt;figcaption&gt;</code>：定义 figure 元素的标题，应该被置于 figure 元素的第一个或最后一个子元素的位置。</li><li><code>&lt;cite&gt;</code>：表示所包含的文本对某个参考文献的引用，比如书籍或者杂志的标题。</li><li><code>&lt;blockquoto&gt;</code>：定义块引用，块引用拥有它们自己的空间。</li><li><code>&lt;q&gt;</code>：短的引述（跨浏览器问题，尽量避免使用）。</li><li><code>&lt;time&gt;</code>：datetime属性遵循特定格式，如果忽略此属性，文本内容必须是合法的日期或者时间格式。</li><li><code>&lt;abbr&gt;</code>：简称或缩写。</li><li><code>&lt;dfn&gt;</code>：定义术语元素，与定义必须紧挨着，可以在描述列表dl元素中使用。</li><li><code>&lt;address&gt;</code>：作者、相关人士或组织的联系信息（电子邮件地址、指向联系信息页的链接）。</li><li><code>&lt;del&gt;</code>：移除的内容。</li><li><code>&lt;ins&gt;</code>：添加的内容。</li><li><code>&lt;code&gt;</code>：标记代码。</li><li><code>&lt;meter&gt;</code>：定义已知范围或分数值内的标量测量。（Internet Explorer 不支持 meter 标签）</li><li><code>&lt;progress&gt;</code>：定义运行中的进度（进程）。</li></ul>',3),c=[d];function a(r,g,n,s,_,h){return l(),t("div",null,c)}const p=e(i,[["render",a]]);export{f as __pageData,p as default};
